(9, 1461917117, '˘@PSÊù¶\0>\0eí', 39036, 11.942462, 46.566633, 'Sportzone Sankt Kassian', 'Zona sportiva San Cassiano', '<p>Die Beachvolleyballanlage in San Ciascian (Gemeinde Abtei) ist eine der h√∂stgelegenen in S√ºdtirol. Gebaggert und gepritscht wird auf 1600 m Mehresh√∂he in der imposanten Dolomitenbergkulisse am Fu√üe des Lavarella und Conturines.</p>', '<p>Il Campo da beach a San Ciascian (Comune di Alta Badia) √® uno dei campi[nbsp] pi√π alti del Alto Adige. Si gioca a 1600 m sopra livello mare davanti alle collone enormi dolomitiche del Lavarell e Conturines.</p>', 'Sportzone San Ciascian/Alta Badia, Str. Plan 59', 'Zona sportiva San Cassiano/Alta Badia, Str. Plan 59', 'Sankt Kassian', 'San Cassiano'),
