(11, 1461918343, 'YœÙ¿RÊù¶\0>\0eí', 39049, 11.439338, 46.893184, 'Balneum Sterzing', 'Balneum Vipiteno', '<p>Das ‚ÄûBalneum Sterzing‚Äú ist ein Sport- und Relaxbad f√ºr die ganze Familie und bietet im Sommerbetrieb Platz f√ºr mehr als 1.000 Badeg√§ste und Sportbegeisterte. Das beliebte Schwimmbad bietet auf einer gro√üen Liegewiese, mit sonnigen und schattigen Pl√§tzen, ein gro√üen Au√üenbecken mit dem neuen Kinderbecken sowie ein auch im Sommer zug√§nglichen Innenbecken!</p>\n<p><span style="line-height: 1.3em;">Das Restaurant mit sonniger Terrasse bietet allen G√§sten den ganzen Tag √ºber Erfrischungsgetr√§nke und Essen!</span></p>', '<p>La piscina √® un impianto per tutta la famiglia. In estate pu√≤ ospitare circa 1.000 ospiti. All''aperto il Balneum offre un prato grande con posti al sole e all''ombra, una piscina grande e anche una nuova piscina per i bambini. Il campo da beach fu rinnovato nella primavera del 2012.</p>', 'Karl-Riedmann-Platz 5', 'Piazza Karl-Riedmann 5', 'Sterzing', 'Vipiteno'),
(12, 1461918545, '˘r^/SÊù¶\0>\0eí', 39031, 11.947522, 46.792163, 'Freibad Bruneck', 'Piscina scoperta Brunico', '<p>Die Beachvolleyballanlage im Brunecker Freischwimmbad z√§hlt zu den sch√∂nsten unseres Landes. Die vier ausgezeichnet pr√§parierten Beachpl√§tze sind mit demselben Quarzsand wie beim j√§hrlich stattfindenden Weltcup in Klagenfurt ausgestattet. Im Fr√ºhjahr 2012 wurden die Innenpl√§tze generalsaniert und bieten ideale Verh√§ltnisse f√ºr spannende Duelle im Sand. Weiters stehen vor dem Freischwimmbad, wie schon in den letzten Jahren, zwei weitere Beachpl√§tze den ganzen Sommer zur Verf√ºgung.</p>', '<p>L''impianto di beachvolley, che si trova presso la piscina all''aperto di Brunico, √® uno dei pi√π belli della nostra provincia. I due campi interni risanati nel 2012 si mostrano in condizioni ottime e sono preparati con la stessa sabbia usata al torneo di coppa del mondo di Klagenfurt. Al esterno della piscina ci si trovano altri due impianti dove si pu√≤ praticare il beachvolley per tutto l''estate.</p>', 'Neurauthstrasse 1', 'Via Neurauth 1', 'Bruneck', 'Brunico');
