(10, 22, 'tl_article', 128, 1461056338, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:9:"Impressum";}', '<p><strong>SSV Bruneck Amateursportverein Sektion Volleyball</strong><br>Ferraristr. 26<br>I-39031 Bruneck (BZ)</p>\n<p>MwSt.Nr./Steuernr. 92015230219</p>\n<p>S√§mtliche Bilder und Texte[nbsp]dieser Website sind urheberrechtlich gesch√ºtzt. Jegliche Verwendung ohne schriftliche Genehmigung ist untersagt. Wir weisen ausdr√ºcklich darauf hin, dass wir keinerlei Einfluss auf die Gestaltung und die Inhalte von Seiten haben, die von dieser Website aus verlinkt sind. Somit √ºbernehmen wir keinerlei Haftung[nbsp]oder Garantie f√ºr den Inhalt dieser Seiten. Wir distanzieren uns klar von der auf diesen Seiten zum Ausdruck gebrachten Meinung, da diese nicht immer unserer Meinung entsprechen kann.</p>\n<p>Copyright: ¬© SSV Bruneck Amateuersportverein</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<h2>Nutzung von Cookies</h2>\n<p>Diese Website verwendet Cookies und verwandte Technologien um das korrekte Funktionieren zu erm√∂glichen und die Nutzung der angebotenen Dienste zu erleichtern.</p>\n<p><strong>Was sind Cookies?</strong><br>Ein Cookie ist ein kurzes Text-Snippet, das von einer von Ihnen besuchten Website an Ihren Browser gesendet wird. Es speichert Informationen zu Ihrem letzten Besuch, wie Ihre bevorzugte Sprache oder andere Einstellungen. So finden Sie sich auf der Website schneller zurecht und nutzen sie effektiver, wenn Sie sie das n√§chste Mal aufrufen. Cookies spielen eine wichtige Rolle. Ohne sie w√§re das Surfen im Web oft frustrierend.</p>\n<p><strong>Warum nutzen wir Cookies?</strong><br>Wir nutzen diese Informationen, um unsere Website zu verbessern, damit unsere Besucher das bestm√∂gliche Angebot erhalten. Unsere Plattform verwendet auch Cookies und √§hnliche Technologien von sorgf√§ltig ausgew√§hlten Drittanbietern.</p>\n<p><strong>Arten von Cookies</strong><br>Diese Website verwendet folgende Cookies:</p>\n<ul>\n<li>technische Cookies und Cookies f√ºr analytische Zwecke: diese Cookies sammeln Informationen √ºber die Nutzung der Website und helfen uns Auswertungen √ºber die Auffindbarkeit der Informationen auf unserer Seite zu bekommen. Dies erfolgt zum Teil √ºber einen Drittanbieter (Google). Diese Informationen sind nicht personenbezogen.</li>\n<li>Drittanbieter-Cookies: dies sind Cookies von anderen Anbietern. Beispiele daf√ºr sind ‚Äúsocial plugins‚Äù f√ºr Facebook, Twitter und Google+. Der Sinn davon ist z.B. das Teilen von Inhalten auf dne Social Network Plattformen zu erm√∂glichen oder zu erleichtern. Genaueres erfahren Sie auf den Informations-Seiten der Drittanbieter.</li>\n</ul>\n<p><strong>Cookies verwalten</strong><br>Sie k√∂nnen Cookies nach Belieben steuern und/oder l√∂schen. Wie, erfahren Sie <a href="http://www.allaboutcookies.org/" target="_blank">hier</a>. Sie k√∂nnen alle auf Ihrem Rechner abgelegten Cookies l√∂schen und die meisten Browser so einstellen, dass die Ablage von Cookies verhindert wird. Dann m√ºssen Sie aber m√∂glicherweise einige Einstellungen bei jedem Besuch einer Seite manuell vornehmen und die Beeintr√§chtigung mancher Funktionen in Kauf nehmen.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
