(9, 11, 1460545472, 'Reglement', 'index.php/reglement.html', 'Reglement Reglement 2015 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier download NEU 2015: Technische Richtlinien f√É¬ºr die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup m√É¬∂chte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige Grunds√É¬§tze schaffen um der Jugendf√É¬∂rderung im Beachvolleyball in S√É¬ºdtirol gerecht zu werden. Die Richtlinien findet ihr hier zum DOWNLOAD Teilnahmeberechtigt: Am √¢‚Ç¨≈æRaiffeisen Beachcup√¢‚Ç¨≈ì k√É¬∂nnen alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht f√É¬ºr die Aktivit√É¬§t Beachvolleyball √É¬ºber das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht √É¬ºber eine Tesserierung beim Fachsportverband FIPAV verf√É¬ºgen, k√É¬∂nnen bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung √¢‚Ç¨≈ætesseramento per evento√¢‚Ç¨≈ì beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open M/F: Die Teilnahme am Turnier wird nur nach Vorlage eines g√É¬ºltigen sport√É¬§rztlichen Attestes (Sportarzt!) gew√É¬§hrt, welches die uneingeschr√É¬§nkte Eignung f√É¬ºr die Aus√É¬ºbung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein g√É¬ºltiges √É¬§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√É¬∂nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder h√É¬∂her gespielt haben. Die selbe Einschr√É¬§nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. F√É¬ºr Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bez√É¬ºglich ihres Spielniveaus. Das OK des Beachcups beh√É¬§lt sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielst√É¬§rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Freizeit Damen: Es sind alle Sportlerinnen teilnahmeberechtigt, welche ein g√É¬ºltiges √É¬§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√É¬∂nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen 1. Division und noch nie in der italienischen Serie C oder h√É¬∂her gespielt haben. Die selbe Einschr√É¬§nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Das OK des Beachcups beh√É¬§lt sich das Recht vor, einzelne Spieler oder Mannschaften aufgrund ihrer Spielst√É¬§rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein g√É¬ºltiges √É¬§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√É¬∂nnen. Es gelten folgende Altersbeschr√É¬§nkungen: U18 M/F: geboren nach dem 01.01.1998 U16 M/F: geboren nach dem 01.01.2000 U14 M/F: geboren nach dem 01.01.2002 Einschreibungen: Die Anmeldungen k√É¬∂nnen ausschlie√É≈∏lich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Pl√É¬§tze verf√É¬ºgbar sind. Die Einschreibung ist nur g√É¬ºltig, wenn die Eigenerkl√É¬§rung bzw. Datenschutzerkl√É¬§rung sowie das √É¬§rztliche Attest (Details dazu unter der jeweiligen Kategorie) ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2015). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren & Damen - Jugend U18 M√É¬§dchen & Buben - Jugend U16 M√É¬§dchen & Buben - Jugend U14 M√É¬§dchen & Buben Es ist aus organisatorischer Sicht nicht m√É¬∂glich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich f√É¬ºr die n√É¬§chste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinns√É¬§tzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. F√É¬ºr die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die Netzh√É¬∂hen gelten wie folgt: U14w - 2,05mU14m - 2,15m U16w - 2,15m U16m - 2,35m U18/Damen - 2,24 m U18/Herren - 2,43m Gesamtwertung: Open: F√É¬ºr die Gesamtwertung werden die Punkte der drei Etappen zusammengez√É¬§hlt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: F√É¬ºr die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengez√É¬§hlt, wobei nur die besten vier Etappen gewertet werden. Freizeit Damen: F√É¬ºr die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengez√É¬§hlt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei der letzten Etappe wird die doppelte Punktezahl vergeben. (1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.) Nenngeb√É¬ºhr*: Die Nenngeb√É¬ºhr beinhaltet den Eintritt in die jeweiligen Schwimmb√É¬§der (falls vorhanden), sowie einmal f√É¬ºr die gesamte Tour ein Spielleibchen des "Raiffeisen Beachcup" pro Spieler. "Bank The Future" Kunden erhalten eine Erm√É¬§√É≈∏igung von 20%. Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von √¢‚Äö¬¨ 15,00 weitergegeben (Materialkosten und Aufdruck). Kategorie Nenngeb√É¬ºhr Erstteilnahme jede weitere Etappe Bank The Future Kunden Open 50 Euro 40 Euro 20% Erm√É¬§√É≈∏igung Freizeit 40 Euro 30 Euro 20% Erm√É¬§√É≈∏igung Jugend 30 Euro 20 Euro 20% Erm√É¬§√É≈∏igung *WICHTIG: f√É¬ºr Spieler welche noch nicht beim Fachsportverband √¢‚Ç¨≈æFIPAV√¢‚Ç¨≈ì gemeldet sind und √É¬ºber das Einschreibeformular (Datenschutzerkl√É¬§rung) eine Tagestesserierung √¢‚Ç¨≈ætesseramento per evento√¢‚Ç¨≈ì beantragen fallen zus√É¬§tzlich 2,00 √¢‚Äö¬¨ pro Etappe an. Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegeb√É¬ºhr trotzdem entrichtet werden. Spielbekleidung: Die Spieler m√É¬ºssen immer mit den offiziellen Turnierdressen spielen. Spielball: Der offizielle Spielball des "Raiffeisen Beachcup" ist der Mikasa VLS300. Dieser wird f√É¬ºr die Spiele vom OK zur Verf√É¬ºgung gestellt. Preisgeld: Pro Turnier wird um folgendes Preisgeld gespielt: Kategorie Open Herren: Erstplatzierte Mannschaft √¢‚Äö¬¨ 160,00, Zweitplatzierte Mannschaft √¢‚Äö¬¨ 120,00, Drittplatzierte Mannschaft √¢‚Äö¬¨ 80,00 Kategorie Open Damen: Erstplatzierte Mannschaft √¢‚Äö¬¨ 120,00, Zweitplatzierte Mannschaft √¢‚Äö¬¨ 80,00, Drittplatzierte Mannschaft √¢‚Äö¬¨ 40,00 Kategorien Freizeit Herren & Damen: Sachpreise f√É¬ºr die ersten 4 Mannschaften. 