(59, 11, 1461919960, 'Reglement', 'de/reglement.html', 'Reglement Reglement 2015 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier download NEU 2015: Technische Richtlinien f√ºr die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup m√∂chte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige Grunds√§tze schaffen um der Jugendf√∂rderung im Beachvolleyball in S√ºdtirol gerecht zu werden. Die Richtlinien findet ihr hier zum DOWNLOAD Teilnahmeberechtigt: Am ‚ÄûRaiffeisen Beachcup‚Äú k√∂nnen alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht f√ºr die Aktivit√§t Beachvolleyball √ºber das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht √ºber eine Tesserierung beim Fachsportverband FIPAV verf√ºgen, k√∂nnen bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung ‚Äûtesseramento per evento‚Äú beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open M/F: Die Teilnahme am Turnier wird nur nach Vorlage eines g√ºltigen sport√§rztlichen Attestes (Sportarzt!) gew√§hrt, welches die uneingeschr√§nkte Eignung f√ºr die Aus√ºbung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein g√ºltiges √§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√∂nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder h√∂her gespielt haben. Die selbe Einschr√§nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. F√ºr Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bez√ºglich ihres Spielniveaus. Das OK des Beachcups beh√§lt sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielst√§rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Freizeit Damen: Es sind alle Sportlerinnen teilnahmeberechtigt, welche ein g√ºltiges √§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√∂nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen 1. Division und noch nie in der italienischen Serie C oder h√∂her gespielt haben. Die selbe Einschr√§nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Das OK des Beachcups beh√§lt sich das Recht vor, einzelne Spieler oder Mannschaften aufgrund ihrer Spielst√§rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein g√ºltiges √§rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen k√∂nnen. Es gelten folgende Altersbeschr√§nkungen: U18 M/F: geboren nach dem 01.01.1998 U16 M/F: geboren nach dem 01.01.2000 U14 M/F: geboren nach dem 01.01.2002 Einschreibungen: Die Anmeldungen k√∂nnen ausschlie√ülich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Pl√§tze verf√ºgbar sind. Die Einschreibung ist nur g√ºltig, wenn die Eigenerkl√§rung bzw. Datenschutzerkl√§rung sowie das √§rztliche Attest (Details dazu unter der jeweiligen Kategorie) ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2015). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren & Damen - Jugend U18 M√§dchen & Buben - Jugend U16 M√§dchen & Buben - Jugend U14 M√§dchen & Buben Es ist aus organisatorischer Sicht nicht m√∂glich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich f√ºr die n√§chste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinns√§tzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. F√ºr die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die Netzh√∂hen gelten wie folgt: U14w - 2,05mU14m - 2,15m U16w - 2,15m U16m - 2,35m U18/Damen - 2,24 m U18/Herren - 2,43m Gesamtwertung: Open: F√ºr die Gesamtwertung werden die Punkte der drei Etappen zusammengez√§hlt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: F√ºr die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengez√§hlt, wobei nur die besten vier Etappen gewertet werden. Freizeit Damen: F√ºr die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengez√§hlt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei der letzten Etappe wird die doppelte Punktezahl vergeben. (1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.) Nenngeb√ºhr*: Die Nenngeb√ºhr beinhaltet den Eintritt in die jeweiligen Schwimmb√§der (falls vorhanden), sowie einmal f√ºr die gesamte Tour ein Spielleibchen des "Raiffeisen Beachcup" pro Spieler. "Bank The Future" Kunden erhalten eine Erm√§√üigung von 20%. Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von ‚Ç¨ 15,00 weitergegeben (Materialkosten und Aufdruck). Kategorie Nenngeb√ºhr Erstteilnahme jede weitere Etappe Bank The Future Kunden Open 50 Euro 40 Euro 20% Erm√§√üigung Freizeit 40 Euro 30 Euro 20% Erm√§√üigung Jugend 30 Euro 20 Euro 20% Erm√§√üigung *WICHTIG: f√ºr Spieler welche noch nicht beim Fachsportverband ‚ÄûFIPAV‚Äú gemeldet sind und √ºber das Einschreibeformular (Datenschutzerkl√§rung) eine Tagestesserierung ‚Äûtesseramento per evento‚Äú beantragen fallen zus√§tzlich 2,00 ‚Ç¨ pro Etappe an. Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegeb√ºhr trotzdem entrichtet werden. Spielbekleidung: Die Spieler m√ºssen immer mit den offiziellen Turnierdressen spielen. Spielball: Der offizielle Spielball des "Raiffeisen Beachcup" ist der Mikasa VLS300. Dieser wird f√ºr die Spiele vom OK zur Verf√ºgung gestellt. Preisgeld: Pro Turnier wird um folgendes Preisgeld gespielt: Kategorie Open Herren: Erstplatzierte Mannschaft ‚Ç¨ 160,00, Zweitplatzierte Mannschaft ‚Ç¨ 120,00, Drittplatzierte Mannschaft ‚Ç¨ 80,00 Kategorie Open Damen: Erstplatzierte Mannschaft ‚Ç¨ 120,00, Zweitplatzierte Mannschaft ‚Ç¨ 80,00, Drittplatzierte Mannschaft ‚Ç¨ 40,00 Kategorien Freizeit Herren & Damen: Sachpreise f√ºr die ersten 4 Mannschaften. Kategorie Jugend: Sachpreise. F√ºr die Gesamtwertung werden dieselben Preisgelder ausbezahlt wie bei einer einzelnen Etappe. Preisverteilung: Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden pr√§miert. Rahmenprogramm: Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2015. Organisation: Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck ASV - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2015. Das Organisationskomitee fungiert lediglich als Koordinator der Tour. Die einzelnen Turniere werden selbstst√§ndig von den lokalen Organisatoren durchgef√ºhrt. Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter √ºbernehmen keinerlei Haftung f√ºr Unf√§lle vor, w√§hrend und nach den Turnieren, auch nicht Dritten gegen√ºber. Jeder einzelne Spieler tr√§gt die volle pers√∂nliche Verantwortung f√ºr seinen Gesundheitszustand. √Ñnderungen: Der Veranstalter beh√§lt sich die M√∂glichkeit vor, Programm√§nderungen durchzuf√ºhren. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden. Beachcup News Letzer Test Unter√ºberschrift zum Beitrag ¬ª Test Unter√ºberschrift zum Beitrag ¬ª Es wird wieder gebaggert! Under construction zum Beitrag ¬ª Den Artikel lesen: Letzer Test, Den Artikel lesen: Test, Den Artikel lesen: Es wird wieder gebaggert!, Banner', 23.22, '185d30a24299818bab4f60964fd59687', '', 0x30, 'de'),
