(70, 10, 1461918836, 'Etappen', 'de/etappen/stage/18.html', 'Etappen Etappen Sterzing 23. bis 24. Juli 2016 Turniere Name Datum Freizeit Herren 23. Juli 2016 U13 m√§nnlich 24. Juli 2016 U14 weiblich 24. Juli 2016 U17 m√§nnlich 24. Juli 2016 U18 weiblich 24. Juli 2016 Veranstaltungsort Balneum Sterzing Das ‚ÄûBalneum Sterzing‚Äú ist ein Sport- und Relaxbad f√ºr die ganze Familie und bietet im Sommerbetrieb Platz f√ºr mehr als 1.000 Badeg√§ste und Sportbegeisterte. Das beliebte Schwimmbad bietet auf einer gro√üen Liegewiese, mit sonnigen und schattigen Pl√§tzen, ein gro√üen Au√üenbecken mit dem neuen Kinderbecken sowie ein auch im Sommer zug√§nglichen Innenbecken! Das Restaurant mit sonniger Terrasse bietet allen G√§sten den ganzen Tag √ºber Erfrischungsgetr√§nke und Essen! Adresse: Karl-Riedmann-Platz 539049 Sterzing Organisator Volleyball Sterzing Egon Volgger coolsport@gmx.net +39 335 5915562 Beachcup News Letzer Test Unter√ºberschrift zum Beitrag ¬ª Test Unter√ºberschrift zum Beitrag ¬ª Es wird wieder gebaggert! Under construction zum Beitrag ¬ª Den Artikel lesen: Letzer Test, Den Artikel lesen: Test, Den Artikel lesen: Es wird wieder gebaggert!, Banner', 12.17, '19986ca791cbc7b9464131981511ccf2', '', 0x30, 'de'),
